import React from 'react';
import FotoReact from '../assets/Javaimage.png';

function Technologies() {
  return (
    <section id="technologies" className="technologies">
      <h2>Tecnologias</h2>
      <ul>
        <li>
          <img src={FotoReact} alt="Minha Foto" className="profile-photo" />
          Java (Spring) 
        </li>
        <li>JavaScript (React)</li>
        <li>Python (Django)</li>
        <li>HTML5</li>
        <li>CSS3</li>
      </ul>
    </section>
  );
}

export default Technologies;
